import 'bootstrap/dist/css/bootstrap.min.css';
import { Fragment } from "react";
import { Provider } from 'react-redux';
import Tablee from './component/Tablee';
import Userhome from './component/Userhome';

function App() {
  return (
    <Fragment>
   <Provider>
     <Userhome></Userhome> 
    <Tablee ></Tablee></Provider>
    </Fragment>
   
  );
}

export default App;
